import React from "react";
import './Glowna.css';

export default function Glowna(){

    return (
        <div>
            <h5>Biuro rachunkowe BALANS powstało z myślą o ludziach, którzy potrzebują pomocy i wsparcia w gąszczu wielu niezrozumiałych przepisów. Nasze biuro powstało, by wesprzeć w opracowaniu dokumentacji kadrowej, płacowej i wielu innych obowiązkach, jakie ciążą na pracodawcach i ich przedsiębiorstwach.</h5>
        </div>
    )
}
